import styles from './OverlayCash.module.css';


function OverlayCash() {
    return (
        <div className={styles.OverlayCash}>
            <div className={styles.container}>
                <h1 className={styles.title}>Danger ahead!</h1>
                <p className={styles.description}>You're a Bomb Square! You hit a bomb<br/>
                and lose all rewards from this field...</p>
                <></>
            </div>
        </div>
    );
}

export default OverlayCash;
